  function initMap() {

    });

  function toggleHeatmap() {
    heatmap.setMap(heatmap.getMap() ? null : map);
  }

    var gradient = [

      'rgba(255, 255, 255, 1)',
      'rgba(255, 255, 255, 251)',

      'rgba(255, 255, 255, 21)',
      'rgba(255, 255, 255, 21)',
      'rgba(255, 255, 255, 21)'
    ]
    heatmap.set('gradient', heatmap.get('gradient') ? null : gradient);
  }

  function changeRadius() {
    heatmap.set('radius', heatmap.get('radius') ? null : 6000000);
